// src/components/Timeline.js
import React from "react";
import "./Timeline.css";

const Timeline = () => {
  const posts = [
    { id: 1, user: "User1", content: "Esta é minha primeira postagem!" },
    { id: 2, user: "User2", content: "Estou adorando a nova interface!" },
    { id: 3, user: "User3", content: "Trinar está incrível!" },
  ];

  return (
    <div className="timeline-container">
      {posts.map((post) => (
        <div key={post.id} className="timeline-post">
          <h3>{post.user}</h3>
          <p>{post.content}</p>
        </div>
      ))}
    </div>
  );
};

export default Timeline;
